syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";



message MainCoop {
	uint32 self_confidence = 2;
	uint32 id = 7;
	Status status = 11;
	repeated uint32 save_point_id_list = 15;
	map<uint32, int32> normal_var_map = 9;
	map<uint32, int32> temp_var_map = 8;
	map<uint32, uint32> seen_ending_map = 12;
	enum Status {
		Status_INVALID = 0;
		Status_RUNNING = 1;
		Status_FINISHED = 2;
	}
}